(function() {
  'use strict';

  var scrollSpeed = 0;
  var scrollRequestId;
  var isScrolling = false;
  var stopButtonBlinkTimeout;

  function createScrollButton(label, color, speed) {
    var button = document.createElement('button');
    button.innerHTML = label;
    button.style.backgroundColor = color;
    button.classList.add("scroll-control-button");
    button.addEventListener('click', function() {
      toggleScrolling(speed);
    });
    return button;
  }

  function toggleScrolling(speed) {
    if (isScrolling && scrollSpeed === speed) {
      stopScrolling();
    } else {
      startScrolling(speed);
    }
  }

  function startScrolling(speed) {
    stopScrolling(); // Stop any ongoing scrolling
    scrollSpeed = speed;//在iOS Safari 中测试发现以更快的滚动速度执行时，页面出现残影和抖动，查找信息尝试修改无果，如果你能修复此问题不甚感激
    scrollLoop();//Testing in iOS Safari found that when executing at a faster scrolling speed, the page appears ghosting, and jitter I tried to modify it to no avail, if you can fix this issue would be very helpful

    isScrolling = true;//Tests in iOS Safari ergaben, dass die Seite bei einer schnelleren Scrollgeschwindigkeit geghostet wurde und zitterte. Ich habe vergeblich versucht, es zu beheben, und ich würde es nicht schätzen, wenn Sie dies beheben könnten


  }

  function stopScrolling() {
    scrollSpeed = 0;// Тестирование в iOS Safari показало, что при выполнении с более высокой скоростью прокрутки страница выглядит призрачной, и дрожание Я пытался изменить его, но безрезультатно, если вы можете исправить эту проблему, это было бы очень полезно

    cancelAnimationFrame(scrollRequestId);
    isScrolling = false;
  }

  function blinkStopButton(button) {
    button.style.animation = "blink-animation 1s infinite";
    button.addEventListener('click', function() {
      toggleScrolling(0);
      clearTimeout(stopButtonBlinkTimeout);
      stopButtonBlinkTimeout = null;
      button.style.animation = "none";
    });

    // 自动停止按钮闪烁5秒后取消闪烁
    stopButtonBlinkTimeout = setTimeout(function() {
      button.style.animation = "none";
      stopButtonBlinkTimeout = null;
    }, 2000);
  }

  function scrollLoop() {
    window.scrollBy(0, scrollSpeed);
    if (scrollSpeed > 0) {
      scrollRequestId = requestAnimationFrame(scrollLoop);
    }
  }

  function keydownHandler(event) {
    if (event.code === 'Space') {
      startScrolling(2);
    }
  }

  function keyupHandler(event) {
    if (event.code === 'Space') {
      stopScrolling();
    }
  }

  GM_addStyle(`
    .scroll-control-button {
      width: 40px;
      height: 40px;
      border-radius: 50%;
      margin-bottom: 10px;
      margin-right: 10px;
      display: flex;
      align-items: center;
      justify-content: center;
      font-size: 24px;
      box-shadow: 0 0 5px rgba(0, 0, 0, 0.3);
    }

    #scroll-buttons {
      position: fixed;
      bottom: 10px;
      right: 10px;
      z-index: 9999999;
    }

    #scroll-buttons button:nth-of-type(1) {
      background-color: #ff0;
    }

    #scroll-buttons button:nth-of-type(2) {
      background-color: #ff0;
    }

    #scroll-buttons button:nth-of-type(3) {
      background-color: #ff0;
    }

    #scroll-buttons button:nth-of-type(4) {
      background-color: #f00;
    }

    @keyframes blink-animation {
      0% { opacity: 1; }
      50% { opacity: 0; }
      100% { opacity: 1; }
    }
  `);

  // 检查是否已存在滚动按钮，如果不存在则创建
  if (!document.getElementById('scroll-buttons')) {
    var scrollButtons = document.createElement('div');
    scrollButtons.id = 'scroll-buttons';

    var fastButton = createScrollButton('🐰', '#ff0', 5);
    var mediumButton = createScrollButton('🐸', '#ff0', 2);
    var slowButton = createScrollButton('😃', '#ff0', 1);
    var stopButton = createScrollButton('⏸️', '#f00', 0);

    scrollButtons.appendChild(fastButton);
    scrollButtons.appendChild(mediumButton);
    scrollButtons.appendChild(slowButton);
    scrollButtons.appendChild(stopButton);

    document.body.appendChild(scrollButtons);

    // 自动闪烁 stop 按钮
    blinkStopButton(stopButton);

    // 监听键盘事件
    document.addEventListener('keydown', keydownHandler);
    document.addEventListener('keyup', keyupHandler);
  }
})();